package main

import (
	"fmt"
	"strings"
)

func main() {
	digitOne := ""
	digitTwo := ""
	digitThree :=
		""
	digitFour :=
		""
	digitFive :=
		""
	one := getDigit(digitOne)
	two := getDigit(digitTwo)
	three := getDigit(digitThree)
	four := getDigit(digitFour)
	five := getDigit(digitFive)
	fmt.Println(one, two, three, four, five)
}

func getDigit(instructions string) int {
	x := 0
	y := 0
	newInstruct := strings.Split(instructions, "")
	for _, direction := range newInstruct {
		switch direction {
		case "U":
			y = y + 1
		case "R":
			x = x + 1
		case "D":
			y = y - 1
		case "L":
			x = x - 1
		}

		switch {
		case x < -1:
			x = -1
		case x > 1:
			x = 1
		case y < -1:
			y = -1
		case y > 1:
			y = 1
		}
	}
	if x == -1 {
		if y == -1 {
			return 7
		}
		if y == 0 {
			return 4
		}
		return 1
	}

	if x == 0 {
		if y == -1 {
			return 8
		}
		if y == 0 {
			return 5
		}
		return 2
	}

	if x == 1 {
		if y == -1 {
			return 9
		}
		if y == 0 {
			return 6
		}
		return 3
	}

	return 10000
}
